import React,{useState,useEffect} from 'react';
import { makeStyles,withStyles} from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

import IconButton from '@material-ui/core/IconButton';
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';
import Button from '@material-ui/core/Button';
import Header from './Header';
import { useLocation } from 'react-router-dom';



const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '70vw',
    },
    },
    table: {
        
        // width:'70vw'
    },
    tableContainer: {
        margin: 'auto auto',
        width:'70vw'
        
    },
    tableHead:{
        // backgroundColor:'grey'
    }
    
    
}));
const StyledTableCell = withStyles((theme) => ({
  head: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
        // width:'70vw'
  },
  body: {
      fontSize: 14, 
    //   width:'70vw'
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
        },
    //   width:'70vw'
  },
}))(TableRow);



function UserInfo(props) {
    const [rows, setRows] = useState([
        { "name": "Nishant Chandra", "userName": "nishant123","email":"nishant@gmail.com","dob":"2021-09-12" },
        { "name": "Naman Das", "userName": "naman123","email":"naman@gmail.com","dob":"2920-09-12" },
        { "name": "Navin Das", "userName": "navin123","email":"navin@gmail.com","dob":"2000-08-2" },
        { "name": "Neeraj Das", "userName": "neeraj123","email":"neeraj@gmail.com","dob":"2011-09-1" },
        { "name": "Pratham das", "userName": "pratham123","email":"pratham@gmail.com","dob":"1019-04-22" },
        
        
    ]);
    const location=useLocation()
    console.log(location.state)

    
    const classes = useStyles();
    return (
        <div>
            <Header val="Logout"></Header>
            <br></br>
            <TableContainer component={Paper} className={classes.tableContainer} style={{marginBottom:'20px'}} >
                <Table className={classes.table} aria-label="customized table">
                    <TableHead style={{backgroundColor:'grey',color:'white'}}>
                    <TableRow >
                        <StyledTableCell>Name</StyledTableCell>
                        <StyledTableCell>User Name</StyledTableCell>
                        <StyledTableCell>Email</StyledTableCell>
                        <StyledTableCell>D.O.B</StyledTableCell>
                        
                        <StyledTableCell  align='right' style={{marginRight:'5px',marginLeft:'auto'}}></StyledTableCell>
                    </TableRow>
                    </TableHead>
                    <TableBody>
                    {rows.map((row) => (
                        <StyledTableRow key={row.index}>
                            <StyledTableCell component="th" scope="row">
                                {row.name}
                            </StyledTableCell>
                            <StyledTableCell component="th" scope="row">
                                {row.userName}
                            </StyledTableCell>
                            <StyledTableCell component="th" scope="row">
                                {row.email}
                            </StyledTableCell>
                            <StyledTableCell component="th" scope="row">
                                {row.dob}
                            </StyledTableCell>
                            <StyledTableCell align='right'></StyledTableCell>
                            
                        
                            
                        
                        </StyledTableRow>
                    ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
}

export default UserInfo;
